import React, { useEffect, useState } from 'react';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch('http://localhost:5000/api/data')
      .then(res => res.json())
      .then(setData);
  }, []);

  return (
    <div>
      <h1>Items from DB</h1>
      <ul>
        {data.map((item, i) => (
          <li key={i}>{item[1]}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
